const Descripcion = () => { 

    return (
        <IonList>
            <br/>
            <IonItem>
                <IonLabel position='fixed'>Precio $ </IonLabel>
                <IonInput type='number' min='0'  />
            </IonItem>
            <br/>
            <IonCard>
                <IonCardHeader>
                <IonCardTitle >Descripcion</IonCardTitle>
                </IonCardHeader>
                <IonTextarea rows={6} maxlength={150} />
            </IonCard>
        </IonList>
    );
}

export default Descripcion;
